import * as types from '../consts/parkingLot';

export const getParkingLotsRequest = () => ({
  type: types.GET_PARKING_LOTS_REQUEST
});

export const getParkingLotsSuccess = (parkingLots) => ({
  type: types.GET_PARKING_LOTS_SUCCESS,
  parkingLots
});

export const getParkingLotsFailure = (error) => ({
  type: types.GET_PARKING_LOTS_FAILURE, 
  error
});
